  [],\n\t\"revision_timestamp\": \"2015-12-20T19:00:38.519184\",\n\t\"name\": \"linkages-between-reef-fish-demographics-and-benthic-habitat-characteristics-in-tutuila-american\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic habitats play vital roles in the
  distribution and abundances of marine resources. Understanding how fish populations
  respond to variability of benthic habitat characteristics is essential for effective
  coral reef management and monitoring. This pilot study was conducted by NOAA Pacific
  Islands Fisheries Science Center (PIFSC) Coral Reef Ecosystem Program (CREP) for
  the Island of Tutuila, American Samoa to examine the relationships and linkages
  between the geomorphological benthic characteristics and fish demographics.nGeomorphological
  metrics characterizing benthic habitats including slope, rugosity, curvature, and
  convexity were derived for the Island of Tutuila, American Samoa using a gridded
  multibeam bathymetry collected by CREP in 2004 and 2006. The fish assemblages and
  abundance data were collected during Rapid Ecological Assessment (REA) surveys from
  2010 to 2015. These fish data were collected according to a stratified random survey
  design using depth as an environmental correlate. Based on the analysis preliminary
  evidence was found that using both depth and convexity to define strata may result
  in more precise estimates of fish biomass. This analysis, however, will be expanded
  to include other areas of the Pacific before an improvement in sampling efficiency
  can be confirmed.nnResults and data from this initial analysis can be accessed online
  via the Pacific Islands Benthic Habitat Mapping Center website at http://www.soest.hawaii.edu/pibhmc/pibhmc_documentation.htm#other_pubs.\",\n\t\"license_title\":
